  "Parameter": [
    {
      "ID": "CO",
      "Name": "Kohlenmonoxid",
      "Einheit": "mg/m3",
      "Beschreibung": "Kohlenmonoxid (CO) ist ein farb- und geruchloses, schlecht wasserlösliches Gas. Es entsteht hauptsächlich bei unvollständigen Verbrennungsprozessen und kann in fast allen Verbrennungsabgasen nachgewiesen werden. Der motorisierte Strassenverkehr ist eine der Hauptquellen der CO-Emissionen."
    },
    {
      "ID": "SO2",
      "Name": "Schwefeldioxid",
      "Einheit": "µg/m3",
      "Beschreibung": "Schwefeldioxid SO2 ist ein farbloses, leicht wasserlösliches, stechend riechendes Gas. Es entsteht bei der Verbrennung fossiler schwefelhaltiger Energieträger wie Kohle und Öl. Schwefeldioxid ist der klassische Luftschadstoff des Wintersmogs der vergangenen Jahrzehnte."
    },
    {
      "ID": "O3",
      "Name": "Ozon",
      "Einheit": "µg/m3",
      "Beschreibung": "Ozon (O3) ist ein normaler Bestandteil der Atmosphäre. In höheren Schichten (Stratosphäre) schützt es das Leben auf der Erde vor der schädlichen UV-Strahlung der Sonne. In den tieferen Luftschichten gefährdet es als wichtigster Bestandteil des Sommersmogs den Menschen und seine Umwelt. Hier bildet sich Ozon unter dem Einfluss des Sonnenlichts aus Stickoxiden (NOx) und flüchtigen organischen Verbindungen (VOC). Dabei kommt den Abgasen des Motorfahrzeugverkehrs die grösste Bedeutung zu."
    },
    {
      "ID": "NOx",
      "Name": "Stickoxide",
      "Einheit": "ppb",
      "Beschreibung": "Stickoxide oder Stickstoffoxide ist ein Sammelbegriff für zahlreiche gasförmige Oxide des Stickstoffs. Stickstoffmonoxid (NO) und Stickstoffdioxid (NO2) werden als NOx zusammengefasst."
    },
    {
      "ID": "NO",
      "Name": "Stickstoffmonoxid",
      "Einheit": "µg/m3",
      "Beschreibung": "Stickstoffmonoxid ist ein farb- und geruchloses giftiges Gas. Es ist eine chemische Verbindung aus den Elementen Stickstoff und Sauerstoff und gehört zur Gruppe der Stickoxide. NO ist ein Radikal, das in der Atmosphäre in das giftigere Stichstoffdioxid (NO2) umgewandelt wird."
    },
    {
      "ID": "NO2",
      "Name": "Stickstoffdioxid",
      "Einheit": "µg/m3",
      "Beschreibung": "Stickoxide (NOx) entstehen als unerwünschte Nebenprodukte bei Verbrennungsvorgängen. Dabei reagiert vor allem der Luftstickstoff (N2) mit dem Sauerstoff (O2) der Verbrennungsluft. Bei diesem Prozess entsteht Stickstoffmonoxid (NO), das erst in der Atmosphäre in das giftigere Stickstoffdioxid (NO2) umgewandelt wird."
    },
    {
      "ID": "PM10",
      "Name": "Schwebestaub PM10",
      "Einheit": "µg/m3",
      "Beschreibung": "Lungengängiger Feinstaub ist eine Mischung von kleinsten Teilchen mit weniger als einem Hundertstel Millimeter Durchmesser (10 µm). Sie unterscheiden sich in Grösse, Herkunft und Wirkung. Dazu zählen, nebst natürlichen mineralischen Anteilen, Abriebteilchen von Pneus und Strassenbelag, Aufwirbelungen, Russteilchen aus Holzfeuerungen auch Dieselruss sowie Partikel aus illegaler Abfallverbrennung. Eine wichtige Rolle spielt zudem die Partikelbildung aus gasförmigen Vorläuferschadstoffen, namentlich Stickoxiden, Schwefeldioxid und Ammoniak. Zudem haften an den Partikeln aus Verbrennungsprozessen Substanzen wie polyaromatische Kohlenwasserstoffe (PAK) und Dioxine, die teils krebserregend und erbgutschädigend wirken können."
    },
    {
      "ID": "PM2.5",
      "Name": "Schwebestaub PM2.5",
      "Einheit": "µg/m3",
      "Beschreibung": "Lungengängiger Feinstaub ist eine Mischung von kleinsten Teilchen mit weniger als zweieinhalb Tausendstel Millimeter Durchmesser (2.5 µm). Sie unterscheiden sich in Grösse, Herkunft und Wirkung. Dazu zählen, nebst natürlichen mineralischen Anteilen, Abriebteilchen von Pneus und Strassenbelag, Aufwirbelungen, Russteilchen aus Holzfeuerungen auch Dieselruss sowie Partikel aus illegaler Abfallverbrennung. Eine wichtige Rolle spielt zudem die Partikelbildung aus gasförmigen Vorläuferschadstoffen, namentlich Stickoxiden, Schwefeldioxid und Ammoniak. Zudem haften an den Partikeln aus Verbrennungsprozessen Substanzen wie polyaromatische Kohlenwasserstoffe (PAK) und Dioxine, die teils krebserregend und erbgutschädigend wirken können."
    },
    {
      "ID": "PN",
      "Name": "Partikelanzahl",
      "Einheit": "1/cm3"
    },
    {
      "ID": "O3_max_h1",
      "Name": "Ozon, höchstes Stundenmittel",
      "Einheit": "µg/m3",
      "Beschreibung": "Höchster Ozon-Stundenmittelwert eines Tages"
    },
    {
      "ID": "O3_nb_h1>120",
