      "Beschreibung": "Anzahl Ozon-Stundenmittelwerte über dem Grenzwert von 120 µg/m3"
    },
    {
      "ID": "T",
      "Name": "Lufttemperatur",
      "Einheit": "°C",
      "Beschreibung": "Physikalisch betrachtet ist die Lufttemperatur ein Mass für den Wärmezustand eines Luftvolumens. Dieser wird bestimmt durch die mittlere kinetische Energie der ungeordneten Molekularbewegung in der Luft. Je grösser die mittlere Geschwindigkeit aller Moleküle in einem Luftvolumen ist, um so höher ist auch seine Lufttemperatur."
    },
    {
      "ID": "T_min_h1",
      "Name": "Lufttemperatur, höchstes Stundenmittel",
      "Einheit": "°C",
      "Beschreibung": "Höchstes Stundenmittel der Lufttemperatur im Mittelungsintervall."
    },
    {
