      "Name": "Lufttemperatur, kleinstes Stundenmittel",
      "Einheit": "°C",
      "Beschreibung": "Kleinstes Stundenmittel der Lufttemperatur im Mittelungsintervall."
    },
    {
      "ID": "p",
      "Name": "Luftdruck",
      "Einheit": "hPa",
      "Beschreibung": "Mit Luftdruck wird der von der Masse der Luft unter der Wirkung der Erdanziehung ausgeübte Druck bezeichnet. Er ist definiert als das Gewicht der Luftsäule pro Flächeneinheit vom Erdboden bis zur äusseren Grenze der Atmosphäre."
    },
    {
      "ID": "WD",
      "Name": "Windrichtung",
      "Einheit": "°",
      "Beschreibung": "Die Windrichtung ist die Richtung, aus welcher der Wind weht. Sie wird bestimmt nach dem Polarwinkel (Azimut). Zur Richtungsangabe benutzt man die 360 Grad Skala des Kreises. Alle Richtungsangaben in Grad sind rechtweisend auf geographisch Nord bezogen, d.h. Ost = 90°, Süd = 180°, West=270° und Nord=360°."
    },
    {
      "ID": "WVv",
      "Name": "Windgeschwindigkeit (vektoriell)",
      "Einheit": "m/s",
      "Beschreibung": "Unter Windgeschwindigkeit ist die horizontale Verlagerungsgeschwindigkeit der Luftteilchen zu verstehen"
    },
    {
      "ID": "WVs",
      "Name": "Windgeschwindigkeit (skalar)",
      "Einheit": "m/s",
      "Beschreibung": "Unter Windgeschwindigkeit ist die horizontale Verlagerungsgeschwindigkeit der Luftteilchen zu verstehen"
    },
    {
      "ID": "rH",
      "Name": "relative Luftfeuchtigkeit",
      "Einheit": "%",
      "Beschreibung": "Die relative Luftfeuchtigkeit gibt das Gewichtsverhältnis des momentanen Wasserdampfgehalts zu dem Wasserdampfgehalt an, der für die aktuelle Temperatur und den aktuellen Druck maximal möglich ist."
    },
    {
      "ID": "RainDur",
      "Name": "Niederschlagsdauer",
      "Einheit": "min",
      "Beschreibung": "Anzahl der Minuten in denen es im Mittelungsintervall geregnet hat."
    },
