      "Einheit": "W/m-2",
      "Beschreibung": "Die Globalstrahlung ist die am Boden von einer horizontalen Ebene empfangene Sonnenstrahlung und setzt sich aus der direkten Strahlung (der Schatten werfenden Strahlung) und der gestreuten Sonnenstrahlung (diffuse Himmelsstrahlung) aus der Himmelshalbkugel zusammen."
    }
  ],
